import {Component, Components} from 'react'

const styles = {
    Layout: {
        backgroundColor: '#fff',
        color: '#0A283E',
        allignItems:'center',
        display: 'flex',
        flexDirection: 'column'
    }
}
class Layout extends Component {
    render(){
        return(
            <div style={styles.Layout}>
            <div>
                {this.props.children}
            </div>
        </div>
        )
    }
}

export default Layout
